void handleInput() {
    u16 value = JOY_readJoypad(JOY_1);
	
    if (!plr.isMoving) {
		plr.velocity.x = 0;
		
		if(!plr.isOnFloor){
			plr.velocity.y += FIX32(1);
		} else {
			plr.velocity.y = 0;
		}
		
        if (value & BUTTON_RIGHT)
        {
			plr.velocity.x = FIX32(5);
		}
        else if (value & BUTTON_LEFT)
        {
			plr.velocity.x = FIX32(-5);
		}
        if (value & BUTTON_UP)
        {
			if(plr.isOnFloor){
				plr.velocity.y = FIX32(-10);
			}
        }
    }
}

int main()
{
	plr.isMoving = FALSE;
	plr.isOnFloor = FALSE;
	plr.position.x = FIX32(160);
	plr.position.y = FIX32(950);
	plr.velocity.x = 0;
	plr.velocity.y = 0;
	
    u16 ind;
    ind = TILE_USER_INDEX;
	
    VDP_loadTileSet(&bga_tileset, ind, DMA);
	bga = MAP_create(&bga_map, BG_B, TILE_ATTR_FULL(0, FALSE, FALSE, FALSE, ind));
	
	//VDP_setPaletteColors(0, palette_all.data, 16*2);
    PAL_setColors(PAL0, palette_all.data, 16*2, DMA);
	SPR_init();
    PAL_setPalette(PAL3, spr_cup.palette->data, DMA);
    //VDP_setPalette(PAL3, spr_cup.palette->data);
    cup_obj = SPR_addSprite(&spr_cup, fix32ToInt(plr.position.x), fix32ToInt(plr.position.y), TILE_ATTR(PAL3, 0, FALSE, FALSE));

	setCameraPosition(&camera, bga, fix32ToInt(plr.position.x), fix32ToInt(plr.position.y));
	//setCameraPosition(&camera, bga, fix32ToInt(plr.pos.x)-1, fix32ToInt(plr.pos.y)-1);
    SPR_setPosition(cup_obj, fix32ToInt(plr.position.x) - camera.position.x, fix32ToInt(plr.position.y) - camera.position.y);
	
	SPR_update();
	SYS_doVBlankProcess();

    while(1)
    {
		SPR_update();
		handleInput();
		moveEntity(&plr, COLLISION_MAP_WIDTH, COLLISION_MAP_HEIGHT, &level);
		
		VDP_showFPS(FALSE);
		setCameraPosition(&camera, bga, fix32ToInt(plr.position.x), fix32ToInt(plr.position.y));
        SPR_setPosition(cup_obj, fix32ToInt(plr.position.x) - camera.position.x, fix32ToInt(plr.position.y) - camera.position.y);
        
		SYS_doVBlankProcess();
    }
	
    return (0);
}
